import Vue from "vue";
import App from "./App.vue";
import router from "./router";

Vue.config.productionTip = false;

let data = {
  users: [{ username: "admin", password: "1234" }],
  current: "",
  saved: [],
};

new Vue({
  router,
  data,
  render: (h) => h(App),
}).$mount("#app");
